import { useQueryClient, useQuery } from "react-query";
import { getPros1Data } from "../util/api";
import { useEffect } from "react";

const usePropsQuery = () => {
  const queryClient = useQueryClient();

  const { data } = useQuery("temp", () => {
    getPros1Data("1");
  });

  useEffect(() => {
    console.log(data);
  }, [data]);

  return { data };
};

export default usePropsQuery;
